        const res = await axios.get('http://localhost:4000/posts');
        setPosts(res.data)
    }

    useEffect(()=>{
        fetchPosts()
    }, [])
    const renderedPosts = Object.values(posts).map(post=>{
        return <div className='card' sytle={{width:'30%', marginBotton:'20px'}}>
                <div className='"card-body'>
                    <h3>{post.title}</h3>
                </div>
        </div>
    })
    return <div/>
}
